function Webapp(){

  useEffect(() => {
    fetch('http://datamall2.mytransport.sg/ltaodataservice/BusArrivalv2?BusStopCode=66271')
    .then(res => res.json())
    .catch(console.log)
    console.log(res)
  })

  return(
    <div className="section middle-container">
      <h1>Nextbus</h1>
    </div>
  )
}

export default Webapp
